import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';
import logo from '../images/logo.png';
import * as actions from '../actions/index';
import Header from './Header';

const imgStyle = {
    width: '250px',
	height: '70px',
	lineHeight: '55px',
	fontSize: '55px',
	margin: '0'
};


const listStyle = {
    padding: '5px'
};

class HeaderNew extends Component {
    render() {
        return (
            <header id="js-header">
            <div className="container clearfix">
                <nav className="white">
                    <div>
                        <img className="left" src={logo} style={imgStyle}/>
                    <ul className="right" style={listStyle}>
                        <li><Link to="/" className="black-text">Home</Link></li>
						<li><Link to="/Services" className="black-text">Services</Link></li>
						<li><Link to="/ContactUs" className="black-text">Contact Us</Link></li>
						<li><Link to="/AboutUs" className="black-text">About Us</Link></li>
                    </ul>
                    </div>
                </nav>
            </div>
        </header>
        );
    }
}

export default HeaderNew;
